(0,n.uE)('<div class="about-samp-container" data-v-9e0be264><div class="about-samp-inner" data-v-9e0be264><h1 data-v-9e0be264>San Andreas Multiplayer (скорочено SA:MP)</h1><p data-v-9e0be264>San Andreas Multiplayer (скорочено SA:MP) — безкоштовна багатокористувацька модифікація для відеогри Grand Theft Auto: San Andreas у версії для Windows з закритим початковим кодом. Розробляється командою «SA-MP Team» на добровільній основі, провідними програмістами проекту є дві особи з нікнеймами Kalcor (Kye) і Spookie.</p><h2 data-v-9e0be264>Історія</h2><h3 data-v-9e0be264>Vice City Multiplayer</h3><p data-v-9e0be264>За основу модифікації було використано аналогічну модифікацію попередньої гри серії, Grand Theft Auto: Vice City під назвою Vice City Multiplayer, випущену у квітні 2005 року. Команда творців складалася з кількох осіб, відомих у спільноті модифікаторів Grand Theft Auto, на чолі з kyeman (Kye) (наразі відомий як Kalcor) — значущою особою у спільноті модобудівничих GTA. Надаючи знімки екрана та відео, які демонстрували плин розробки (що відбувалася достатньо швидко), модифікація набула загального визнання серед GTA-спільноти та з невеликим форумом залучила близько 120 користувачів перед переїздом на новий хостинг. </p><p data-v-9e0be264>Після ряду публічних бета-тестів, які набули величезної популярності (багатьом навіть доводилося чекати звільнення місць на бета-серверах), Vice City Multiplayer було нарешті випущено і майже відразу оновлено до версії 0.1d, до кінця вже маючи відкритий початковий код. Цей код було використано іншою командою розробників для продовження розвитку VC-MP (цей проект досі розвивається і наразі має версію 0.4), а команда kyeman&#39;а (Kalcor&#39;a) розпочала розробку SA-MP. Крім того, теперішні розробники VC-MP роблять багатокористувацьку гру як для оригінальної гри Grand Theft Auto: Vice City, так і для модифікації, що переносить місто Ліберті-Сіті на рушій гри. </p><h3 data-v-9e0be264>San Andreas Multiplayer</h3><p data-v-9e0be264>Розробка SA-MP привернула великий інтерес шанувальників ігор серії GTA. У квітні 2006 року розділу на форумі GTAForums.com стало недостатньо, і розробники вирішили відкрити власний форум. У кінці березня розробка вже була повноцінним мультиплеєром і, після деяких закритих бета-тестів, у квітні-травні було проведено три публічних бета-тести. За кілька годин після третього бета-тесту, 10 травня 2006 року kyeman (Kalcor) заявив, що проект повністю готовий до випуску. Однак у релізі виявилося досить багато багів, і за кілька днів було випущено оновлення до версії 0.1b. Після цього користувачі продовжили вивчати мову програмування Pawn і створювати різноманітні ігрові режими, а самі розробники зникли на деякий час. Лише наприкінці червня в повідомленні на своєму блозі вони заявили, що розробка все ще триває, хоча в них дуже мало часу. Розробники продемонстрували кілька скріншотів можливості додавання об&#39;єктів на карту. Ходили чутки, що незабаром вийде версія 0.1c, але до вересня нової інформації від розробників не надходило. Лише наприкінці вересня невелике оновлення блогу свідчило, що розробка триває, і було представлено невеликий список нововведень.</p><p data-v-9e0be264>2 жовтня 2006 року з&#39;явилася інформація про те, що готується нова версія 0.2. Інформацію було підкріплено великим списком нововведень і відеороликом, що показує безліч нових можливостей. Це викликало хвилю інтересу серед шанувальників SA-MP, яких тоді налічувалося вже кілька тисяч по всьому світу. Однак після цього нової інформації не було кілька місяців. Розробка дуже затягнулася і, після декількох невеликих оновлень, 9 березня 2007 року розробники представили на своєму блозі прев&#39;ю версії 0.2 з великим списком змін і двома відеороликами, знятими на закритих бета-тестах. Також було оголошено, що незабаром буде проведено кілька публічних бета-тестів. До початку першого публічного бета-тесту пройшов іще місяць. До того часу ажіотаж з приводу нової версії досяг неймовірно великого рівня, і розробники вирішили не оголошувати про бета-тестування на своєму блозі. Натомість напередодні Великодня, 8 квітня, на сайті розробників з&#39;явилася пасхалка у вигляді посилання, яке через кілька перенаправлень виводило користувача на IRC-канал бета-тестування, що розпочалося ввечері того ж дня. Спочатку було відкрито один сервер на 100 місць, але незабаром було запущено ще декілька серверів. Це бета-тестування тривало до 11 квітня. Наступний бета-тест пройшов лише за місяць і тривав кілька годин. Метою його було протестувати можливість сервера витримувати навантаження до 200 гравців. Після цього на блозі kyeman (Kalcor) оголосив, що буде проведено ще щонайменше два бета-тести. Наприкінці травня пройшов перший з них, після чого у блозі було оголошено деякі нововведення. 3 червня 2007 року розробники випустили RC-версію клієнта і сервери 0.2 на чотири місця, тим самим дозволивши користувачам розпочати розробку й оновлення режимів для нової версії. Протягом наступних двох тижнів було випущено ще два реліз-кандидати, і після четвертого бета-тестування, що перейшло у п&#39;яте, 20 червня 2007 року SA-MP 0.2 була офіційно випущена. Але розробка не завершилася, і за кілька днів уже було випущено версію 0.2.1 з деякими оновленнями та виправленнями.</p><p data-v-9e0be264>24 червня 2007 несподівано для користувачів команда SA-MP оголосила на своєму сайті, що припиняє роботу над модом і будь-яку його підтримку, бо не мають більше сил і можливостей боротися з людьми, які, не боячись нічого, розробляють чіти та експлойти для SA-MP. Миттєво в Інтернеті була організована петиція з вимогою до розробників повернутися до роботи над модом. За кілька годин під петицією підписалося кілька тисяч чоловік. Це спрацювало, і менше ніж за добу роботу всіх серверів SA-MP було відновлено. Наступного дня було випущено оновлення для сервера, що закриває експлойт, попереджує падіння серверу і містить вбудований античіт SAC (англ. SA-MP Anti-Cheat), що не дозволяє гравцям заходити у гру з чітерськими трейнерами або плаґінами для SA-MP. За місяць, 29 серпня 2007 року, після двох відкритих бета-тестів було випущено версію 0.2.2 і було оголошено про початок роботи над версією 0.3. А наступного дня, 30 серпня, було випущено клієнт SA-MP версії 0.2.2 R2, що усуває кілька помилок, знайдених у версії 0.2.2 відразу ж після релізу.</p><p data-v-9e0be264>13 травня 2008 року, несподівано для всіх, команда SA-MP закрила сайт і оголосила про кінець розробки SA-MP. За кілька днів сайт був відновлено, і на ньому з&#39;явилася новина про закінчення розробки SA-MP. Вночі 23 травня було відновлено форум. 21 червня 2008 року для вирішення проблем з безпекою було випущено версію 0.2.2 R3. Також в оновленні були виправлені деякі баги і збільшено обмеження кількості моделей машин. Оновлення стосувалося лише клієнта.</p><p data-v-9e0be264>20 листопада 2008 року було випущено версію SA-MP 0.2x. Більшість змін не були значними для звичайного гравця, за винятком поліпшення синхронізації та усунення проблем з вильотом клієнта. У вкладці «Internet» сервери версії 0.2.2 більше не з&#39;являються. Більшість серверів переведено на версію SA-MP 0.2x. Також було оголошено про розробку версії SA-MP 0.3. Раніше обіцяну версію SA-MP 0.2.5 випущено не буде.</p><p data-v-9e0be264>14 серпня 2009 року розпочалися публічні бета-тестування SA-MP 0.3. 15 серпня відбулося друге бета-тестування, в якому взяло участь понад 400 гравців. 19 жовтня було випущено фінальну версію 0.3a. Згодом було випущено кілька незначних оновлень в лінійці даної версії. 11 серпня 2010 року розпочалося тестування версії 0.3b, а її випуск відбувся 21 серпня 2010 року. 28 листопада 2010 року до мережі потрапили клієнт і сервер (Windows і Linux) RC2-версії 0.3c.</p><p data-v-9e0be264>На початку 2012 року вийшла версія SA: MP 0.3d. У травні 2012 року вийшов SA: MP 0.3e. На початку 2013 року вийшов клієнт SA: MP 0.3x. 13 лютого 2014 року офіційно вийшли клієнт і сервер 0.3z. 18 січня 2015 року вийшла перша бета-версія SA: MP 0.3.7 RC-1. Розробники урізноманітнили гілку 0.3. До даної версії було внесено значні зміни.</p><p data-v-9e0be264>1 травня 2015 року вийшов SA: MP 0.3.7. 13 липня 2015 року вийшло оновлення для сервера SA: MP 0.3.7 R2. 4 листопада 2017 року вийшла тестова версія SA: MP 0.3.8. 13 січня 2018 року версія SA: MP 0.3.8 була скасована та анонсована нова версія SA: MP 0.3.DL, яка дає можливість розробникам ігрових серверів завантажувати модифікації на сервер (нові моделі персонажів, об&#39;єктів).</p><h2 data-v-9e0be264>Ігровий процес</h2><p data-v-9e0be264>Всі ігрові сервери SA-MP відносяться до одного чи кількох жанрів. Найпоширенішими жанрами є:</p><ul data-v-9e0be264><li data-v-9e0be264><span data-v-9e0be264>Дрифт (англ. Drift)</span> — режим, схожий на політ, в якому гравці заробляють очки, контролюючи заноси на спеціально розроблених картах. </li><li data-v-9e0be264><span data-v-9e0be264>Перегони (англ. Race)</span>, беручи участь у яких, необхідно виграти якомога більше коштів.</li><li data-v-9e0be264><span data-v-9e0be264>Рольова гра (англ. Roleplay)</span> — найпопулярніший режим, мета якого полягає в імітуванні реального життя. </li><li data-v-9e0be264><span data-v-9e0be264>Стантрайдинг (англ. Stunt)</span> — додано предмети для виконання акробатичних трюків на транспортних засобах. </li><li data-v-9e0be264><span data-v-9e0be264>Deathmatch</span> — кожен грає сам за себе, мета — вбити якомога більше супротивників.</li><li data-v-9e0be264><span data-v-9e0be264>Freeroam</span> — вільна гра, суміш декількох режимів.</li><li data-v-9e0be264><span data-v-9e0be264>Team Deathmatch</span> — гра ведеться в командах, мета — вбити якомога більше гравців команди-суперниці. </li><li data-v-9e0be264><span data-v-9e0be264>Truck</span> — на сервері присутні лише вантажівки та причепи, мета — розвозити товари вантажівкою та заробити собі на життя. </li></ul><p data-v-9e0be264>Деякі елементи ігрового процесу містять контрольні та початкові точки, бонуси, зброю та різноманітні об&#39;єкти — від рамп до вибухових діжок. Багато онлайн-серверів містять нетипові ігрові режими, що використовують скриптовий рушій, включений до SA-MP. Прикладами можуть бути такі ігрові режими, як Freeroam, де гравці можуть вільно пересуватися картою Сан-Андреаса, чи змагальні режими на кшталт Race, Destruction / Demolition Derby, Team DeathMatch і Fallout, де персонажі гравців опиняються в повітрі на скляній платформі, що раптово падає після показу, гравці мають стрибати шматками платформи, а останній вцілілий виграє. Принцип Fallout подібний до Hay, де гравці мусять вилазити на копиці сіна та бути на першій з них. Останній режим також демонструє, як багато ігрових режимів і скриптів можна створити на скриптовому рушії SAMP із нескінченними можливостями та різновидами.</p><p data-v-9e0be264>Існує багато специфічних жанрів ігор і спільнот, як-от гра ролі з реального життя, класична рольова гра й ігрові спільноти, що пропонують широке розмаїття різних ігрових режимів, іноді разом на одному сервері. Сьогодні середня кількість ігрових серверів Сан-Андреаса в San Andreas Multiplayer сягає понад 4000 з загальною кількістю гравців онлайн 19—23 тис. одночасно.</p><h3 data-v-9e0be264>Рольова гра</h3><p data-v-9e0be264>Рольова гра (англ. Role-Playing Game, RPG) — гра, в якій гравці створюють єдину історію з особистостями своїх персонажів. В інших іграх (як-от Metin2[en]) поняття ролі загалом не розуміється. Хоча більшість Інтернет-ігор називається рольовими, вони навіть віддалено не мають з ними нічого спільного. В SA-MP цей термін називається RolePlay. Тому рольові сервери не є окремими «рольовими іграми». GTA San Andreas — багатокористувацька гра за грою.</p><p data-v-9e0be264>Починаючи гру на багатьох серверах, гравець безробітний, але має деякі кошти. Йому потрібно знайти професію та заробити гроші. У грі він зіткнеться з такими поняттями, як «за роллю» (IC), «поза роллю» (OOC) та «суперечить ролі» (NON-RP). Їх значення зазначено нижче:</p><dl data-v-9e0be264><dt data-v-9e0be264>In-Character</dt><dd data-v-9e0be264>Життя не гравця, а його персонажа. Це не гра, в яку він грає, це життя, яким живе його персонаж.</dd><dt data-v-9e0be264>Out-of-Character</dt><dd data-v-9e0be264>Речі поза життям персонажа. Наприклад, речення «Якою клавішею сісти на пасажирське сидіння?» не є рольовим. </dd><dt data-v-9e0be264>NON-RP</dt><dd data-v-9e0be264>Персонаж не зображає реальну людину. Прикладом цього є відкриття вогню, озираючись при цьому.</dd><dt data-v-9e0be264>Суміш</dt><dd data-v-9e0be264>Наприклад, гра позаігрових речей всередині гри.</dd><dt data-v-9e0be264>Метагра</dt><dd data-v-9e0be264>В реальному житті ніхто не знає нічиїх імен до особистого знайомства. У грі персонаж також не повинен знати імен інших. Якщо хтось, не знаючи когось, звертається до нього на ім&#39;я чи іншим чином поводиться так, ніби знає його, це метагра. </dd><dt data-v-9e0be264>Павергра</dt><dd data-v-9e0be264>Порушення балансу та ролі шляхом виконання дій, які неможливо здійснити в реальному житті. Наприклад, взяти будь-який з усіх типів транспортних засобів у грі. </dd></dl><p data-v-9e0be264>Часто використовувані команди на рольових серверах:</p><dl data-v-9e0be264><dt data-v-9e0be264>/b [текст]</dt><dd data-v-9e0be264>Нерольова команда. Тексти можуть читатися на відстані.</dd><dt data-v-9e0be264>/s [текст]</dt><dd data-v-9e0be264>Команда крику. Сказане можна почути на відстані. Рольова команда.</dd><dt data-v-9e0be264>/do [текст]</dt><dd data-v-9e0be264>Використовується для того, щоб показати, доповісти чи нагадати іншим гравцям про те, що відбувається. Рольова команда. Зазвичай використовується, коли ігрової графіки недостатньо. </dd><dt data-v-9e0be264>/me [текст]</dt><dd data-v-9e0be264>Рольова команда, що використовується для позначення власних дій. Відображається, наприклад, як <span data-v-9e0be264>[Ім&#39;я] [текст]</span>. Використовується, коли ігрова графіка не є адекватною. Наприклад, <span data-v-9e0be264>/me дивиться крізь вікно автомобіля</span>, <span data-v-9e0be264>/me загоряється</span>, <span data-v-9e0be264> /me посміхається.</span></dd><dt data-v-9e0be264>/help</dt><dd data-v-9e0be264>Команда, за допомогою якої можна дізнатися про рольові та нерольові команди, а також правила серверу. Зазвичай містить усі команди на сервері. </dd></dl><h2 data-v-9e0be264>Можливості</h2><h3 data-v-9e0be264>Скриптинг</h3><p data-v-9e0be264>Завдяки скриптовому рушієві мовою Pawn, вбудованому в SA-MP, будь-який користувач із певними знаннями у програмуванні може розробляти власні ігрові режими та фільтрувальні скрипти. Також сьогодні існує велика кількість ігрових режимів у вільному використанні, зокрема багато великих рольових і MMORPG режимів, як-от PEN1:LS, The Godfather і GTO. Pawn дозволяє будь-кому створювати цілі місії в межах ігрового світу GTA San Andreas. Кожний ігровий режим або фільтрувальний скрипт використовується сервером у вигляді окремого файлу. В будь-який момент може бути запущено лише один ігровий режим і не більше 16 фільтрувальних скриптів. Режим, як правило, виконує основні функції ведення ігрового процесу, тоді як фільтрувальні скрипти відповідають за сторонні функції серверу, які можна вмикати та вимикати в будь-який момент без шкоди для ігрового процесу. Втім, таке розділення вельми умовне й нічого не заважає перенести всю функціональність до режиму чи навпаки, до фільтрувальних скрипів. Скриптовий API серверу містить як активні функції, що виконується в певний момент, так і перехоплювачі події, що виконуються автоматично під час певних подій, як-от підключення гравця до серверу, запуск або зупинка режиму тощо.</p><p data-v-9e0be264>Можна розділяти ігровий режим і фільтрувальні скрипти. Попри відсутність систематичних відмінностей між режимом і кодуванням скрипту є важливі подробиці. Під час входу до гри спочатку відкривається перший режим у <span data-v-9e0be264>server.cfg</span>, а лише потім побічні режими. Щойно режим завантажується до папки <span data-v-9e0be264>gamemodes</span>, він записується як <span data-v-9e0be264>gamemode0</span> (без розширення) з <span data-v-9e0be264>server.cfg</span>. Скрипти відокремлюються від фільтрувальних скриптів на основі рядка <span data-v-9e0be264>gl_actions</span>. Якщо замість <span data-v-9e0be264>gamemode0</span> написано <span data-v-9e0be264>gamemode1</span>, скрипти не працюватимуть.</p><p data-v-9e0be264>Файли скриптів є файлами коду, які можна можна додати поза режимом замість додавання до самого режиму. За необхідності їх можна активувати та дезактивувати без вимикання режиму. Це спрямовано на полегшення режиму. Якщо всі файли скриптів вставити до режиму, то їх завантаження та редагування займатиме час.</p><h3 data-v-9e0be264>Конфігураційні файли</h3><p data-v-9e0be264>Налаштування модифікації для мережевої гри у Grand Theft Auto: San Andreas під назвою San Andreas Multiplayer (скорочено SA-MP) можливе як на боці сервера, так і на боці клієнта. Перший спосіб налаштувань впливає на всіх гравців певного сервера, тоді як другий — лише на того гравця, який зробив свої налаштування. Відповідно, серверні параметри зберігаються у файлі <span data-v-9e0be264>server.cfg</span>, а клієнтські — у файлі <span data-v-9e0be264>sa-mp.cfg</span>. Формат обох файлів подібний до INI файлів, але дещо спрощений, наприклад, не використовується розподіл параметрів за секціями.</p><h3 data-v-9e0be264>Режими</h3><p data-v-9e0be264>Стандартний набір серверу містить декілька простих режимів і фільтрувальних скриптів, які демонструють застосування основних функцій мультиплеєру. Багато поширених сьогодні режимів є тією чи іншою мірою модифікаціями стандартних режимів. До основних ігрових режимів відносяться:</p><dl data-v-9e0be264><dt data-v-9e0be264>Barron або RC Barnstorm</dt><dd data-v-9e0be264>Ігровий режим з метою знищення транспортних засобів з дистанційним керуванням інших гравців.</dd><dt data-v-9e0be264>Grand Larceny (Grandlarc)</dt><dd data-v-9e0be264>Офіційний режим жанру Freeroam, створений SA-MP Team.</dd><dt data-v-9e0be264>Rivershell</dt><dd data-v-9e0be264>Режим жанру Team DeathMatch на річці, розташованій у Сан-Фієрро.</dd></dl><h3 data-v-9e0be264>Команди серверу</h3><p data-v-9e0be264>Скриптом режиму задаються ігрові команди, які починаються з символу / та використовуються для полегшення гри, наприклад, <span data-v-9e0be264>/help</span> — допомога, <span data-v-9e0be264>/kill</span> — самогубство, <span data-v-9e0be264>/stats</span> — статистика. В кожному режимі свої команди, серед яких телепортація, довідка, початок перегонів, створення маркеру, адміністративні команди й інші.</p><h3 data-v-9e0be264>Плагіни</h3><p data-v-9e0be264>Починаючи з версії 0.2, мультиплеєр підтримує можливість створення плагінів, які розширюють можливості серверу. Найпопулярнішими є плагіни для роботи з СКБД MySQL, чатами IRC-мережі та розсиланням електронних листів протоколом SMTP.</p><div class="source-link" data-v-9e0be264><p data-v-9e0be264>Матеріал було взято з сайту: <a href="https://uk.wikipedia.org/wiki/San_Andreas_Multiplayer" data-v-9e0be264>https://uk.wikipedia.org/wiki/San_Andreas_Multiplayer</a></p></div></div></div>',1);function pt(a,t,d,e,s,l){const r=(0,n.up)("SampTable");return(0,n.wg)(),(0,n.iD)("div",vt,[ot,(0,n.Wm)(r)])}const ct={class:"samp-table"},bt=(0,n.uE)('<div class="samp-info" data-v-7458158b><div class="samp-logo" data-v-7458158b><img alt="" src="'+E+'" data-v-7458158b></div><div class="short-info" data-v-7458158b><div class="short-info-inner" data-v-7458158b><table data-v-7458158b><tr data-v-7458158b><td data-v-7458158b><p data-v-7458158b>Тип</p></td><td data-v-7458158b><p data-v-7458158b>Модифікація</p></td></tr><tr data-v-7458158b><td data-v-7458158b><p data-v-7458158b>Автор(и)</p></td><td data-v-7458158b><p data-v-7458158b>Kalcor (Kye), Spookie</p></td></tr><tr data-v-7458158b><td data-v-7458158b><p data-v-7458158b>Розробник</p></td><td data-v-7458158b><p data-v-7458158b>SA-MP Team</p></td></tr><tr data-v-7458158b><td data-v-7458158b><p data-v-7458158b>Перший випуск</p></td><td data-v-7458158b><p data-v-7458158b>0.1 (10 травня 2006)</p></td></tr><tr data-v-7458158b><td data-v-7458158b><p data-v-7458158b>Стабільний випуск</p></td><td data-v-7458158b><p data-v-7458158b>0.1 (10 травня 2006)</p></td></tr><tr data-v-7458158b><td data-v-7458158b><p data-v-7458158b>Нестабільний випуск</p></td><td data-v-7458158b><p data-v-7458158b>0.3.7 (1 травня 2015 <br data-v-7458158b> 6 років тому[1])</p></td></tr><tr data-v-7458158b><td data-v-7458158b><p data-v-7458158b>Нестабільний випуск</p></td><td data-v-7458158b><p data-v-7458158b>0.3.DL (25 січня 2018 <br data-v-7458158b> 3 роки тому[2])</p></td></tr><tr data-v-7458158b><td data-v-7458158b><p data-v-7458158b>Платформа</p></td><td data-v-7458158b><p data-v-7458158b>Багатоплатформність</p></td></tr><tr data-v-7458158b><td data-v-7458158b><p data-v-7458158b>Операційна система</p></td><td data-v-7458158b><p data-v-7458158b>Windows <br data-v-7458158b> Linux (тільки ігровий сервер)</p></td></tr><tr data-v-7458158b><td data-v-7458158b><p data-v-7458158b>Мова програмування</p></td><td data-v-7458158b><p data-v-7458158b>Pawn</p></td></tr><tr data-v-7458158b><td data-v-7458158b><p data-v-7458158b>Розмір</p></td><td data-v-7458158b><p data-v-7458158b>15,5 МБ (0.3.7) <br data-v-7458158b> 14,9 МБ (0.3.DL)</p></td></tr><tr data-v-7458158b><td data-v-7458158b><p data-v-7458158b>Доступні мови</p></td><td data-v-7458158b><p data-v-7458158b>Англійська</p></td></tr><tr data-v-7458158b><td data-v-7458158b><p data-v-7458158b>Стан розробки</p></td><td data-v-7458158b><p data-v-7458158b>Активний</p></td></tr><tr data-v-7458158b><td data-v-7458158b><p data-v-7458158b>Ліцензія</p></td><td data-v-7458158b><p data-v-7458158b>Вільна</p></td></tr><tr data-v-7458158b><td data-v-7458158b><p data-v-7458158b>Вебсайт</p></td><td data-v-7458158b><a href="https://www.sa-mp.com/" data-v-7458158b>sa-mp.com</a></td></tr></table></div></div></div>',1),ut=[bt];function mt(a,t,d,e,s,l){return(0,n.wg)(),(0,n.iD)("div",ct,ut)}var _t={name:"SampTable"};const ht=(0,S.Z)(_t,[["render",mt],["__scopeId","data-v-7458158b"]]);var ft=ht,gt={name:"About_Samp",components:{SampTable:ft}};const At=(0,S.Z)(gt,[["render",pt],["__scopeId","data-v-9e0be264"]]);var Pt=At;const St={class:"rp-termins"},wt=(0,n.uE)('<div class="rp-termins-inner" data-v-3204263e><h1 data-v-3204263e>Для чого потрібно знати РП-терміни?</h1><p data-v-3204263e>РП-терміни - це дуже важливі правила на всіх РП серверах в GTA SA-MP, які ні в кому разі не можна порушувати. Якщо вони порушуються то вам буде винесено покарання від <span data-v-3204263e>кіку</span> та <span data-v-3204263e>варну</span>, навіть до <span data-v-3204263e>бану</span>.</p><p data-v-3204263e>РП-терміни були створені для підтримування порядку та відіграшу ролевої гри на сервері. Їх обов&#39;язково запитують при прийомі в будь-яку організацію на сервері. Дуже важливо пройти перевірку при прийомі. РП-терміни є НонРП поняттями, на них потрібно відповідати тільки якщо у Вас запитують про це в ООС чат <span data-v-3204263e>(/b)</span>. Якщо ж у Вас запитують, наприклад, що таке СК в IC чаті, то потрібно відповісти будь-що, але не СпавнКілл. Наприклад: Сидячий кіт. МГ – у НонРП чаті – Метагеймінг, а в РП чаті – Метання Гранат. Дотримуючись цих простих правил, ви не провалитеся при прийомі в будь-яку з фракцій або банд. В армії діють такі ж РП терміни, як і на всьому сервері.</p><h2 data-v-3204263e>Основне:</h2><dl data-v-3204263e><dt data-v-3204263e>Role-Play (скорочення Rp)</dt><dd data-v-3204263e>Реальна гра, реальна поведінка, як у житті, гра за ролями.</dd><dt data-v-3204263e>Non Role-Play (Скорочення NonRp)</dt><dd data-v-3204263e>Не реальна гра, дія, як цей персонаж не вчинив би у житті. Порушення режиму Rp.</dd><dt data-v-3204263e>OOC (Out Of Character)</dt><dd data-v-3204263e>Це все, що стосується реального світу (пишеться в <span data-v-3204263e>/b</span> NonRP-чат).</dd><dt data-v-3204263e>IC (In Character)</dt><dd data-v-3204263e>Це все, що стосується віртуального світу, тобто ігри (пишеться у звичайний чат).</dd></dl><h2 data-v-3204263e>Терміни, назви дій гравця:</h2><dl data-v-3204263e><dt data-v-3204263e>Revenge kill (РК)</dt><dd data-v-3204263e>Вбити гравця за те, що він убив тебе.</dd><dt data-v-3204263e>Mеtagаming (МГ)</dt><dd data-v-3204263e>Використання OOC інформації в IC.</dd><dt data-v-3204263e>Powergaming (ПГ)</dt><dd data-v-3204263e>Уява супер героя. Приклад: бійка 1х3.</dd><dt data-v-3204263e>Bunnyhopping (БХ)</dt><dd data-v-3204263e>Стрибати, щоб швидше пересуватися.</dd><dt data-v-3204263e>Deatmatch (ДМ)</dt><dd data-v-3204263e>Вбивати всіх підряд без IC причини.</dd><dt data-v-3204263e>DriveBy (ДБ)</dt><dd data-v-3204263e>Вбивство машиною або з розстріл з місця водія.</dd><dt data-v-3204263e>Spawn kill (СК)</dt><dd data-v-3204263e>Вбивство на респауні (на місці появи).</dd><dt data-v-3204263e>Team kill (ТК)</dt><dd data-v-3204263e>Вбивство члена своєї команди, фракції.</dd><dt data-v-3204263e>Сharacter kill (КK)</dt><dd data-v-3204263e>Вбивство, щоб повністю ліквідувати будь-якого персонажа, що у грі. Іншими словами - вбивство з метою по Rp розлучитися з людиною. Яскравим прикладом є звільнення з мафії. Є частиною відігравання Rp. </dd><dt data-v-3204263e>FastReload (ФР)</dt><dd data-v-3204263e>Баг із швидкою перезарядкою.</dd><dt data-v-3204263e>RepeatKill (РеК)</dt><dd data-v-3204263e>Намірне повторне вбивство одного гравця.</dd><dt data-v-3204263e>Fastmoving (ФМ)</dt><dd data-v-3204263e>Баг із швидким переміщенням.</dd><dt data-v-3204263e>Willihopping (ВХ)</dt><dd data-v-3204263e>Це стрибок з велосипеда, мопеда, мотоцикла.</dd></dl><h2 data-v-3204263e>Покарання:</h2><dl data-v-3204263e><dt data-v-3204263e>Ban</dt><dd data-v-3204263e>Покарання після якого, гравець, не зможе продовжити гру на сервері.</dd><dt data-v-3204263e>Warn</dt><dd data-v-3204263e>Покарання після якого гравець буде звільнений з організації, і не зможе вступити назад навіть до іншої організації. </dd><dt data-v-3204263e>Kick</dt><dd data-v-3204263e>Закінчення ігрового сеансу (те саме якщо ввести /q).</dd><dt data-v-3204263e>Бан чату</dt><dd data-v-3204263e>Гравець не зможе писати повідомлення в чати. Дається на 5хв або більше.</dd><dt data-v-3204263e>Форт ДеМорган</dt><dd data-v-3204263e>В&#39;язниця на військовій базі, з якої ви не зможете вибратися за допомогою адвокатів.</dd></dl><h2 data-v-3204263e>Інші терміни:</h2><dl data-v-3204263e><dt data-v-3204263e>AFK – Away From Keyboard</dt><dd data-v-3204263e>Відійшов від клавіатури (заборонено бути в АФК без натиснутої клавіші ESC).</dd><dt data-v-3204263e>Role-Play Nickname</dt><dd data-v-3204263e>Нік у форматі: Ім&#39;я_Прізвище. Приклад: Gareth_Bale.</dd><dt data-v-3204263e>Фракція</dt><dd data-v-3204263e>Організація, банда, мафія і т.д. Приклад: SF Army, LS News, The Rifa Gang.</dd><dt data-v-3204263e>Noob (Нуб)</dt><dd data-v-3204263e>Новачок, гравець, що не розуміє суті гри RP, гравець не вміє грати.</dd><dt data-v-3204263e>Spawn (ReSpawn)</dt><dd data-v-3204263e>Місце появи персонажа на сервері. На ігровому сленгу – &quot;Респ&quot;.</dd></dl><div class="source-link" data-v-3204263e><p data-v-3204263e>Матеріал було взято з сайту: <a href="https://zoneg.ru/raznoe/kak-pravilno-igrat-po-rp-v-sampe.html" data-v-3204263e>https://zoneg.ru/raznoe/kak-pravilno-igrat-po-rp-v-sampe.html</a></p></div></div>',1),yt=[wt];function Mt(a,t,d,e,s,l){return(0,n.wg)(),(0,n.iD)("div",St,yt)}var kt={name:"Rp-termins"};const Rt=(0,S.Z)(kt,[["render",Mt],["__scopeId","data-v-3204263e"]]);var Ct=Rt;const Tt=[{path:"/",name:"Home",component:ba},{path:"/about",name:"About",component:Pa},{path:"/contact",name:"Contact",component:Ka},{path:"/extra",name:"Extra",component:it},{path:"/extra/about-samp",name:"About_Samp",component:Pt},{path:"/extra/rp-termins",name:"RP_termins",component:Ct},{path:"/contact/successful",name:"SuccessfulSend",component:Ba},{path:"/:catchAll(.*)",name:"NotFound",component:xa}],xt=(0,L.p7)({history:(0,L.PO)("/"),routes:Tt});var Ot=xt;(0,e.ri)(F).u